import React, { Component } from 'react';
import '../App.css';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import ModalDialog from 'react-bootstrap/ModalDialog'
import ModalHeader from 'react-bootstrap/ModalHeader'
import ModalTitle from 'react-bootstrap/ModalTitle'
import ModalBody from 'react-bootstrap/ModalBody'
import ModalFooter from 'react-bootstrap/ModalFooter'

export default class ModalTest extends Component { 
    constructor(props) {
        super(props);
        this.state = {
            show: true
        };

        this.handleClose = this.handleClose.bind(this);
        this.handleShow = this.handleShow.bind(this);
    }

    handleClose (){
        this.setState({ show: false });
    };

    handleShow (){
        this.setState({ show: true });
    };

    render() {
        return(
            <div>

                <Modal show={this.state.show} onHide={this.handleClose} dialogClassName="modal-custom" scrollabl={true}>
                    <ModalBody style={{maxHeight: 'calc(80vh - 180px)', overflowY: 'auto'}} > 
                    <br></br>
                    <br></br>
                    <center> <h1 style={{ fontSize: 30, fontWeight: 800}}> Please Accept our Terms and Conditions </h1></center>
